                if (this.filters[key + '<'] !== undefined && this.filters[key + '<'].val <= value) {return false;}
                if (this.filters[key + '>='] !== undefined && this.filters[key + '>='].val > value) {return false;}
                if (this.filters[key + '<='] !== undefined && this.filters[key + '<='].val < value) {return false;}
